script: |
  super -f text -I q9074.spq | sort > q9074.out

inputs:
  - name: q9074.spq
    data: |
      SELECT DISTINCT - col1 AS col2 FROM tab0 (FORMAT parquet) AS cor0 WHERE - 15 * col1 NOT IN ( + 24, + 5 * + - col0, - - 44, - col0 / col1 );
  - name: tab0

outputs:
  - name: q9074.out
    data: |
      -1
      -21
      -81
